import React from 'react';
import './App.css';
import Header from './Components/Header';
import HomeBanner from './Components/HomeBanner';
import Login from './Components/Login';
import Banner from './Components/Banner';
import List from './Components/List';
import { Route, Router, Routes } from 'react-router-dom';


function App() {
  return (
    <div>
      <Routes>
        <Route
          path="/"
          element={
            <React.Fragment>
              <Header />
              <HomeBanner />
            </React.Fragment>
          }
        />
        <Route
          path="/login"
          element={
            <React.Fragment>
              <Header />
              <Login  />
            </React.Fragment>
          }
        />
        <Route
          path="/register"
          element={
            <React.Fragment>
              <Header />
              <Login page={false}/>
            </React.Fragment>
          }
        />

        <Route
          path="/dashboard"
          element={
            <React.Fragment>
              <Header />
              <Banner />
              <List />
            </React.Fragment>
          }
        />
      </Routes>
    </div>
  );
}

export default App;
